// src/components/FavoritCards/FavoritCards.js

import React from "react";
import { useUserContext } from "../../hooks/UserHooks/userContextApp";
// import styleFavoritCards from "./";

const FavoritCards = () => {
  const { likedCards } = useUserContext();

  return (
    <div className="bodyAbout">
      <h1>Favorit Cards</h1>
      <div >
        <ul >
          {likedCards.map((cardId) => (
            <li key={cardId}>
              {/* Display card details here based on cardId */}
              <p>Card ID: {cardId}</p>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default FavoritCards;
